css:
.conflict-resolved {
  background: #d0e6e7;
}
.conflict-ours {
  background: #a2d8f6;
}
.conflict-ours.cursor-line {
  background: #73c5f1;
}
.conflict-theirs {
  background: #b3e2a4;
}
.conflict-theirs.cursor-line {
  background: #92d67d;
}
.conflict-dirty {
  background: #6b207d;
}
.conflict-dirty.cursor-line {
  background: #8e2aa6;
}
